import { Routes, Route, Link } from 'react-router-dom';
import React, { useState, useEffect } from "react";

import { Homepage } from './pages/Homepage';
import { Notfoundpage } from './pages/Notfoundpage';

import { CharactersList } from './pages/CharactersList';
import { Character } from './pages/Character';
import { ItemsList } from './pages/ItemsList';
import { Item } from './pages/item';
import { EquipmentList } from './pages/EquipmentList';
import { Equipment } from './pages/Equipment';

import { Register } from './pages/Register';
import { Auth } from './pages/Auth';
import { Profile } from './pages/Profile';
import {ThemeControl} from './components/ThemeControl'

import { AdminItems } from './pages/adminItems'
import { AdminItem } from './pages/adminItem'
import { AdminNewItem } from './pages/adminNewItem'
import { AdminCharacters } from './pages/adminCharacters'
import { AdminCharacter } from './pages/adminCharacter'
import { AdminNewCharacter } from './pages/adminNewCharacter'
import { AdminEquipments} from './pages/adminEquipments'
import { AdminEquipment } from './pages/adminEquipment'
import { AdminNewEquipment } from './pages/adminNewEquipment'
import { AdminUsers } from './pages/adminUsers'
import { AdminUser } from './pages/adminUser'

function App() {
  const [userData, setUserData] = useState({});

  useEffect(() => {
    const storedUserData = JSON.parse(localStorage.getItem('userInf'));
    if (storedUserData) {
      setUserData(storedUserData);
    }
  }, []);

  const handleGetUser = (userData) => {
    setUserData(userData);
  };

  const routes = [
    { path: '/', element: <Pages.Homepage /> },
    { path: '/characters', element: <Pages.CharactersList /> },
    { path: '/character/:CharacterName', element: <Pages.Character /> },
    { path: '/items', element: <Pages.ItemsList /> },
    { path: '/item/:ItemName', element: <Pages.Item /> },
    { path: '/equipments', element: <Pages.EquipmentList /> },
    { path: '/equipment/:EquipmentName', element: <Pages.Equipment /> },
    { path: '/register', element: <Pages.Register /> },
    { path: '/authorization', element: <Pages.Auth getUser={handleGetUser} /> },
    { path: '/profile', element: <Pages.Profile getUser={handleGetUser} /> },
    { path: '/admindashboard/characters', element: <Pages.AdminCharacters /> },
    { path: '/admindashboard/items', element: <Pages.AdminItems /> },
    { path: '/admindashboard/equipments', element: <Pages.AdminEquipments /> },
    { path: '/admindashboard/users', element: <Pages.AdminUsers /> },
    { path: '/admin/user/:UserId', element: <Pages.AdminUser /> },
    { path: '/admin/character/:CharacterName', element: <Pages.AdminCharacter /> },
    { path: '/admin/newcharacter', element: <Pages.AdminNewCharacter /> },
    { path: '/admin/item/:ItemName', element: <Pages.AdminItem /> },
    { path: '/admin/newitem', element: <Pages.AdminNewItem /> },
    { path: '/admin/equipment/:EquipmentName', element: <Pages.AdminEquipment /> },
    { path: '/admin/newequipment', element: <Pages.AdminNewEquipment /> },
    { path: '*', element: <Notfoundpage /> },
  ];

  return (
    <>
      <header>
        <div className='header-void'></div>
        <div className='header-nav'>
          <Link to="/">Home</Link>
          <Link to="/characters">Characters</Link>
          <Link to="/items">Items</Link>
          <Link to="/equipments">Equipment</Link>
        </div>
        <div className='header-user'>
          <Pages.ThemeControl />
          {userData.login ? (
            <Link to="/profile">{userData.login}</Link>
          ) : (
            <Link to="/authorization">Sign-in</Link>
          )}
        </div>
      </header>

      <Routes>
        {routes.map((route, index) => (
          <Route key={index} path={route.path} element={route.element} />
        ))}
        <Route path="*" element={<Pages.Notfoundpage />} />
      </Routes>
    </>
  );
};

export default App;
